header {
    z-index: 10;
    position: fixed;
    top: 0;
    left: 0;
    font-size: .28rem;
    width: 100%;
    display: box;
    display: -webkit-box;
    display: -moz-box;
    display: -ms-flexbox;
    display: -webkit-flex;
    display: flex;
    -webkit-box-direction: normal;
    -webkit-box-orient: horizontal;
    -moz-flex-direction: row;
    -webkit-flex-direction: row;
    -ms-flex-direction: row;
    -o-flex-direction: row;
    flex-direction: row;
    -webkit-box-pack: space-between;
    -moz-justify-content: space-between;
    -webkit-justify-content: space-between;
    -ms-justify-content: space-between;
    -o-justify-content: space-between;
    justify-content: space-between;
    -webkit-box-sizing: border-box;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    padding-top: .4rem;
}
header .left {
    margin-left: .4rem;
}
header .tool.mine-prize-tool {
    color: #fff;
    display: block;
    background: rgba(0,0,0,.3);
    width: 2.0rem;
    height: 2.0rem;
    text-align: center;
    border-radius: 50%;
    padding: .1rem;
    font-size: .28rem;
    animation: swing 2s ease-in-out infinite;
}
header .tool.mine-prize-tool svg {
    width: 1.4rem;
    height: 1.4rem;
}
header .tool.mine-prize-tool span {
    display: block;
    position: relative;
    top: -7px;
    color: #fff;
    font-size: .24rem;
}
svg:not(:root) {
    overflow: hidden;
}
@keyframes swing{20%{-webkit-transform:rotate(15deg);-ms-transform:rotate(15deg);transform:rotate(15deg)}40%{-webkit-transform:rotate(-10deg);-ms-transform:rotate(-10deg);transform:rotate(-10deg)}60%{-webkit-transform:rotate(5deg);-ms-transform:rotate(5deg);transform:rotate(5deg)}80%{-webkit-transform:rotate(-5deg);-ms-transform:rotate(-5deg);transform:rotate(-5deg)}100%{-webkit-transform:rotate(0);-ms-transform:rotate(0);transform:rotate(0)}}
</style>
<style>
        .coupon {
            position: relative;
            background: #d51d27;
            color: #fff;
            width: 100%;
            /*height: 95px;*/
            line-height: 25px;
            overflow: hidden;
            margin-top: 15px;
        }

        .coupon-diabled {
            background: #c3c3c3;
            color: #666;
        }

        .coupon:after {
            content: ".";
            display: block;
            height: 0;
            clear: both;
            visibility: hidden;
        }

        .coupon-money .sum {
            font-size: 25px;
        }

        .coupon-left {
            float: left;
            text-align: left;
            width: 60%;
            font-size: 12px;
            background: url(./circle-border-left.png) left center no-repeat;
        }

        .coupon-right {
            float: right;
            text-align: center;
            width: 40%;
            font-size: 14px;
            background: url(./circle-border-right.png) right center no-repeat;
        }

        .coupon-inner {
            padding: 10px 15px;
            height: 75px;
            position: relative;
        }

        .coupon-right .coupon-inner {
            border-left: 2px dashed rgba(255,255,255,.5);
        }

        .coupon-money, .coupon-time {
            margin-top: 12px;
        }

        .coupon-circle {
            display: inline-block;
            width: 16px;
            height: 16px;
            background: #fff;
            position: absolute;
            left: -9px;
            border-radius: 50%
        }

            .coupon-circle.top {
                top: -8px;
            }

            .coupon-circle.bottom {
                bottom: -8px;
            }

        .coupon-light {
            position: absolute;
            top: 20px;
            left: 20%;
            height: 150px;
            width: 100%;
            background: rgba(255,255,255,.2);
            transform: rotate(-30deg);
            -webkit-transform: rotate(-30deg);
            -moz-transform: rotate(-30deg);
        }

        .giftfont {
            position: absolute;
            bottom: 0.4rem;
            left: 0px;
            right: 0px;
            font-size: 0.7rem;
            color: white;
        }
    </style>
<header>
        <div class="left">
        <a id="my-ticket" data-target="#my-ticket-half" class="tool mine-prize-tool open-popup">
        <svg class="icon" aria-hidden="true">
            <use xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="#icon-prize"></use>
        </svg>
        <span></span>
        </a>
    </div>
    <div class="right">
            </div>
</header>

<div id="my-ticket-half" class="weui-popup__container" style="display: none;">
        <div class="weui-popup__overlay"></div>
        <div class="weui-popup__modal">
            <div class="toolbar">
                <div class="toolbar-inner">
                    <a href="javascript:;" class="picker-button close-popup"></a>
                    <h1 class="title" style="margin:0;"></h1>
                </div>
            </div>
            <div class="modal-content">
                <div class="weui-grids" id="insert-my-ticket">
                </div>
            </div>
        </div>
    </div>
    <script src="https://cdn.bootcss.com/jquery-weui/1.2.0/js/jquery-weui.min.js"></script>
<script>
    $(function(){
        $('#my-ticket').on('click',function(){
            $.ajax({
                url: "/nineturntable/getTickets",
                async: false,
                type: "GET",
                dataType: "json",
                data: { id: $('#tid').val() },
                success: function (data) {
                    if (!$.isEmptyObject(data)) {
                        $('#insert-my-ticket').html('');
                        $.each(data, function (i, o) {
                            var isgive = o.IsGive==1 ? " coupon-diabled" : "";
                            var html = '<div class="coupon ' + isgive +' "><div class= "coupon-left"><div class="coupon-inner"><div class="coupon-money"><span class="sum">' + o.PrizeName+'</span>';
                            html += '</div><div class="coupon-condition"><p> '+o.PrizeCode+'</p></div></div></div>';
                            html += '<div class="coupon-right"><div class="coupon-inner"><div class="coupon-time"><br>' + o.ExpiresTime +'</div><i class="coupon-circle top"></i>';
                            html += '<i class="coupon-circle bottom"></i></div></div><div class="coupon-light"></div></div>';
                            $('#insert-my-ticket').append(html);
                        });
                    }
                }
            });
        });
    });
</script>